import React from "react";
import { Dropdown, Item } from "semantic-ui-react";
const items = [
    "My Profile",
    "Configuration Notification",
    "Extensions",
    "Log out"
]
const Profile = () => (
  <Dropdown
  style={{marginRight:'20px'}}
    icon={<Item.Image avatar size='big' style={{float:'left', width:'40px', height:'40px'}} src='https://picsum.photos/40/40' />}
    text = "Paul Walker"
  >
    <Dropdown.Menu>
      <Dropdown.Item>My Profile</Dropdown.Item>
      <Dropdown.Item>Configuration Notification</Dropdown.Item>
      <Dropdown.Item>Extensions</Dropdown.Item>
      <Dropdown.Item>Log out</Dropdown.Item>
    </Dropdown.Menu>
  </Dropdown>
);

export default Profile;
